import React from "react";
import Slotm from "./Slotm";

const App = () => {
    return(
        <>
          <h1 className="heading_style"> 🎰 Welcome to <span style={ { fontWeight : "bold" } }> slot Machine </span>  🎰  </h1>
          <div className="slotMachine">
              <Slotm x='😊'  y='😊' z='😊' />
              <Slotm x='😁'  y='😍' z='😊' />
              <Slotm x='😊'  y='😋' z='😎' />
          </div>
        </>
    )
}

export default App;
